import React from "react";
import './style.css';

const Card = ({data}) => {
    return(
    <div className="card">
    <img src={data.strDrinkThumb} class="card-img-top" alt="..."/>
    <div class="card-body">
        <h5 class="card-title">{data.strDrink}</h5>
        <p class="card-text">id:{data.idDrink}</p>
        <a className="btn btn-primary">Ver</a>
    </div>
    </div>
  )
}

export default Card
